import User from "../controllers/USER-controller";

class PageServices{

    async checkForAccess(){

        if(localStorage.getItem('token')){
            const ret = await User.checkAuth();
            
            if(ret?.message){
                return false;
            }else{
                return true;
            }
        }
        return false;
    }

};

export default new PageServices();
